            <img className="profile-icon" src="/images/profile.png" alt="Profile Icon" />
          </Link>
        </div>
      </header>
      <nav className="nav-banner">
        <Link to="/">Home</Link>
        <Link to="/tickets">Tickets</Link>
        <Link to="/reservations">Reservations</Link>
      </nav>

    </>
